content:
Devia ser assim:
1 - Qualquer estudante de qualquer curso em Universidade Pública deveria pagar o curso que nós bancamos com os nossos impostos com 2 anos de trabalho em instituições públicas;
2 - Médico não é obrigado a ir trabalhar em lugar algum do Brasil. Mas também não pode querer impedir de ir quem queira se instalar lá, seja brasileiro ou estrangeiro. Se não querem R$ 10 mil por mês deixem para quem quer (estrangeiros).

Fiz uma pesquisa para saber da importancia do professor, e vejam:
Um médico precisa passar pelo professor;
Um cientista precisa passar pelo professor;
Dentista, engenheiro, e tantas outras profissões, precisam passar por um professor;
Presidente da república, epa, desculpem, minha pesquisa acaba aqui, foi mal.

SEGUNDOS ANTES DO TIRO ELE FALA;

"NOSSA QUEBRADA FUNCIONA MAIS QUE ORAÇÃO"    
é meus queridos, com a palavra de Deus não se brinca .
